description:
Contains: IDW's &quot;Angel&quot; books prior to/outside the &quot;After the Fall&quot; continuity.

THE CURSE (2005) - &quot;Having survived the battle of 'Not Fade Away', we find Angel in Romania, trying to find the Gypsies who cursed him with a soul.&quot;

OLD FRIENDS (2006) - &quot;When a strangely familiar, seemingly vampiric figure is spotted killing victims in LA, Angel is lured back to the city to put a stop to it.&quot;

MASKS (2006) - &quot;One-shot Halloween-themed special issue featuring four short stories starring Angel, Illyria, Cordelia, and Lindsey.&quot;

AULD LANG SYNE (2006) - &quot;While tracking a mysterious cult in LA in hopes of solving a kidnapping, Angel encounters some familiar faces - faces he shouldn't be seeing!&quot;

BLOOD AND TRENCHES (2009) - &quot;In Europe, the First World War ravages nations, but a greater darkness than human conflict calls Angel back across the ocean from America.&quot;

BARBARY COAST (2010) - &quot;A recently souled Angel is on a quest for a 'cure' in San Francisco when, of course, something goes horribly wrong.&quot;

(Teasers from back-covers + &lt;a href=&quot; http://en.wikipedia.org/wiki/Angel_Comics#Mini-series&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt; http://en.wikipedia.org/wiki/Angel_Comics#Mini-series&lt;/a&gt;  )


Excludes: The three episode adaptations &quot;A Hole in the World&quot;, &quot;Not Fade Away&quot;, and &quot;Smile Time&quot;, and the two-part public-domain-crossover &quot;Angel vs Frankenstein&quot;.
